import React from 'react';
import DashboardV from './src/Dashboard';
import HeaderV from './src/Header';
import LineChartV from './src/LineChart';

function App() {
  return (
    <div>
      <HeaderV/>
      <DashboardV/>
      <div style={{width:'600px',}}>
      <LineChartV/>
      </div>

    </div>

  );
}

export default App;
